@coffeespoonie List things you're enthusiastic about. "And I found the nearest spreadsheet trick to do thing!"

Really if you approach it with your moments of joy &amp; efforts at community it'll go well 90% of the time.

And if it goes poorly you can refer to list so you don't freeze up.

@RoseLerner There's a romance novel that has the woman flying back to her home state to get an awesome job &amp; leaving the man hanging because she has a life. 

And a YA fantasy has the young man return to the city to sort out a way to live near his love while pursuing his art.

I love these.
